import React, { useState } from "react";
import { emojis, commands } from "../../data/data";
import Chart from "../charts/chart";
import CommandsStatus from "./commands";
import Channels from "./channels";
import Prefix from "./prefix";
import Table from "./table";
const Dashboard = () => {
  const [prefix, setPrefix] = useState("!");
  const mainPadding = 3;
  const mobilePadding = 2;
  return (
    <div
      className="container-fluid pb-3"
      style={{ maxWidth: "1300px", minHeight: "100%" }}
    >
      <div className="row no-gutters justify-content-between">
        <div
          className={`p-sm-${mainPadding} p-${mobilePadding} col-lg-4 col-md-8 col-sm-8 col-12 col-xl`}
          style={{ height: "300px" }}
        >
          <Channels></Channels>
        </div>
        <div
          className={`col-lg-3 col-md-4 col-sm-4 col-8 p-sm-${mainPadding} p-${mobilePadding}`}
          style={{ height: "300px", maxWidth: "265px" }}
        >
          <Prefix setPrefix={setPrefix} prefix={prefix}></Prefix>
        </div>
        <div
          className={`col-lg-5 col-sm-12 col-12 p-sm-${mainPadding} p-${mobilePadding}`}
          style={{ height: "300px" }}
        >
          <CommandsStatus prefix={prefix}></CommandsStatus>
        </div>
      </div>
      <div className="row no-gutters">
        <div
          className={`col-12 col-md-6 p-sm-${mainPadding} p-${mobilePadding}`}
          style={{ height: "300px" }}
        >
          <div className="pnl convex-1 shn">
            <Chart
              data={{
                title: "Top Emojis",
                units: "times",
                items: emojis,
              }}
            ></Chart>
          </div>
        </div>
        <div
          className={`col-12 col-md-6 p-${mobilePadding} p-sm-${mainPadding}`}
          style={{ height: "300px" }}
        >
          <div className="pnl convex-1 shn">
            <Chart
              data={{
                title: "Top Commands",
                units: "times",
                items: commands.slice(0, 4),
              }}
            ></Chart>
          </div>
        </div>
      </div>
      <div className="row no-gutters">
        <div
          className={`col-auto p-${mainPadding}`}
          style={{ height: "415px" }}
        >
          <Table></Table>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
